class Banner extends Component {

  render () {
    return (
      <div>
  <a class="twitter-timeline" href="https://twitter.com/@dxc119" 
    data-widget-id="@dxc119"
    data-theme="white" 
    data-link-color="#cc0000"
     width="200" height="300" data-chrome="noheader nofooter noborders transparent" lang="ko">
    @xxxxxxx 님의트윗
  </a>
      </div>
    );
  }
}

export default Banner;
